vec3_t barycentric_weights(vec2_t a, vec2_t b, vec2_t c, vec2_t p) {
    // Find vectors between vertices ABC and point P
    vec2_t ab = vec2_sub(b, a);
    vec2_t bc = vec2_sub(c, b);
    vec2_t ac = vec2_sub(c, a);
    vec2_t ap = vec2_sub(p, a);
    vec2_t bp = vec2_sub(p, b);

    // Calculate area of the full triangle using cross products
    double area_full = (ab.x * ac.y - ab.y * ac.x);

    // Alpha weight = area of subtriangle BCP / area of full triangle ABC
    double alpha = (bc.x * bp.y - bc.y * bp.x) / area_full;

    // Beta weight = area of subtriangle ACP / area of full triangle ABC
    double beta = (ap.x * ac.y - ap.y * ac.x) / area_full;

    // Gamma weight = 1 - alpha - beta (all barycentric weights add to 1)
    double gamma = 1 - alpha - beta;

    vec3_t weights = { alpha, beta, gamma };
    return weights;
}
